import React, {useState} from 'react';
import QuestionnairePage from './QuestionnairePage';
import ChooseRolePage from './ChooseRolePage';
import { UserRole } from '../context/UserRole';
import * as Constantans from '../Constants';
import {
    BrowserRouter
    ,Link
    ,Routes
    ,Route
    // ,createRoutesFromElements
    // ,createBrowserRouter
    } from 'react-router-dom'




const SignUpFlow = ({props}) => {
    const [role, setRole] = useState('Diif');
    return (
        <>
        <h1> { role } </h1>
        <button onClick={() => setRole(200)}> setRole </button>
        <UserRole.Provider value={{role, setRole}}>
            <BrowserRouter>
                <Routes>
                    <Route path= {Constantans.CHOOSE_ROLE_PAGE}
                        action={({ props }) => {}}
                        element = {
                            <ChooseRolePage />
                        }
                        exact
                        />;
                    <Route path={Constantans.REG_FORM}
                        action={({ props }) => {}}
                        element = {<QuestionnairePage />}
                        exact
                        />;
                </ Routes>
            </ BrowserRouter>
        </UserRole.Provider>
        </>
  );
                    };
export default SignUpFlow;
